# Функция для выравнивания гистограммы
def histogram_equalization(img_array):
    # Вычисляем гистограмму изображения
    hist, bins = np.histogram(img_array.flatten(), 256, [0, 256])
    # Вычисляем кумулятивную функцию распределения
    cdf = hist.cumsum()
    # Нормализуем CDF
    cdf_normalized = cdf * hist.max() / cdf.max()
    # Маскировка для исключения нулевых значений
    cdf_masked = np.ma.masked_equal(cdf, 0)
    # Выравнивание гистограммы
    cdf_masked = (cdf_masked - cdf_masked.min()) * 255 / (cdf_masked.max() - cdf_masked.min())
    # Заполнение маскированных значений
    cdf = np.ma.filled(cdf_masked, 0).astype('uint8')
    # Применяем преобразование к изображению
    img_equalized = cdf[img_array]
    return img_equalized

# Применяем выравнивание гистограммы
equalized_image = histogram_equalization(image_array)

